import React from 'react'

const Clients = () => {
  return (
    <div className='content' id='clients'>
        <div className="clients-row">
            <div className="client">
                <img src="src/img/6.jpeg" alt="" />
            </div>
        </div>
    </div>
  )
}

export default Clients
